def count_possible_pairs(n, rectangles):

    def insert1(a, b, c):
        if a not in b:
            b[a] = c
        else:
            b[a] += c

    def multMayot(a, b):
        if a % b == 0:
            return b
        else:
            return multMayot(b, a % b)
    cntw = {}
    cnth = {}
    multMayotC = 1
    cntC = 0
    for (w_i, h_i, c_i) in rectangles:
        insert1(w_i, cntw, c_i)
        insert1(h_i, cnth, c_i)
        cntC += c_i
        if multMayotC == 0:
            multMayotC = c_i
        else:
            multMayotC = multMayot(multMayotC, c_i)
    for (w_i, h_i, c_i) in rectangles:
        if cntw[w_i] * cnth[h_i] != cntC * c_i:
            return 0
    result = 0
    i = 1
    while i * i <= multMayotC:
        if multMayotC % i == 0:
            result += 1
            if i * i != multMayotC:
                result += 1
        i += 1
    return result

